用于发起获取资源的请求。它返回一个 promise。使用示例fetch()fetch(url, options).then(function (response) {
    // handle HTTP response
}, function (error) {
    // handle network error
})
更全面的示例。fetch(url, {
    method: "POST",
    headers: {
      "Content-Type": "application/json"
    },
    body: JSON.stringify(data),
    credentials: "same-origin"
}).then(function (response) {
    response.status     //=> number 100–599
    response.statusText //=> String
    response.headers    //=> Headers
    response.url        //=> String

    response.text().then(function(responseText) { ... })
}, function (error) {
    error.message //=> String
})
示例：请求（GET）一个 json 数据fetch('/posts.json').then(function (response) {
    return response.json();
}).catch(function (error) {
    console.log(error);
});
示例：提交（POST）一个表单（序列化为 JSON）信息fetch('/submit.php', {
    method: "POST",
    headers: {
      "Content-Type": "application/json"
    },
    body: JSON.stringify(data),
    credentials: "same-origin"
}).then(function (response) {
    if (response.ok) {
        console.log('Success');
    } else {
        console.log('error');
    }
}).catch(function (error) {
    console.log(error);
});
示例：提交（POST）一个表单信息fetch('/submit.php', {
    method: "POST",
    headers: {
        "Content-Type": "application/x-www-form-urlencoded"
    },
    body: "firstName=Nikhil&favColor=blue&password=easytoguess"
}).then(function (response) {
    if (response.ok) {
        console.log('Success');
    } else {
        console.log('error');
    }
}).catch(function (error) {
    console.log(error);
});
RequestRequest 定义了 HTTP 请求获取资源的 request 格式，接受两个参数: url、options，实际中往往不需要手动 new 一个 request 对象，通过其他操作会返回一个request对象:new Request(url, options)
urlurl (String or Request) - 要获取资源的 URL。

options相对于 XHR 方式，Request 对象可以很方便、明确地显示是否允许跨域(mode)、是否需要携带 cookie (credentials) 等。method (String) - HTTP 请求使用的方法。 默认: "GET"

body (String, Blob, FormData...) - HTTP 请求的 body 信息。注意 GET 或 HEAD 方法的请求不能包含 body 信息。

headers (Object, Headers) - 请求的头信息。默认: {}

credentials (String) - 身份验证凭证模式。 默认: "omit""omit" - 省略，不包括身份验证凭证(e.g. cookies)的请求

"same-origin" - 同源，包括凭证请求相同的网站

"include" - 包括，包括凭证请求所有网站


mode (String) - 请求的模式。"cors"

"no-cors"

"same-origin"


cache (String) - 请求的 cache 模式。"default"

"no-store"

"reload"

"no-cache"

"force-cache"

"only-if-cached"


ResponseResponse 对应 HTTP 的响应，里面包含了服务相应的相关信息，除了在service worker 中，是不需要显示创建。属性status (number) - HTTP 响应码，在 100–599 之间

statusText (String) - 服务器状态文本报告

ok (boolean) - 当 status 为 2xx 是为 true

headers (Headers) - 响应头信息

url (String)

body - 存储响应的内容

type - 指明 HTTP 请求是否跨域、错误等信息

Body 方法无论Request还是Response，里面均存在body属性，该属性存储请求的内容，由于javascript里面数据类型的复杂性: ArrayBuffer、Blob、string、URLSearchParam、FormData，所以fetch提供了mixin类Body，用于处理不同类型的数据。Body除了具有相关数据类型的处理方法外，还有一个字段bodyUsed，用于标示该body是否已经被读取。因为body是stream，只能被读取一次。那么如何要多次读取body里面的内容，就需要首先进行clone。text() - yields the response text as String

json() - yields the result of JSON.parse(responseText)

blob() - yields a Blob

arrayBuffer() - yields an ArrayBuffer

formData() - yields FormData that can be forwarded to another request

